import React from 'react';
import {
  Card,
  CardActions,
  CardContent,
  Button,
  Typography,
} from '@material-ui/core';
import indigo from '@material-ui/core/colors/indigo';
import Head from 'next/head';

const Quiz = () => {
  return (
    <>
      <Head>
        <link rel="stylesheet" href="/pages/quiz/styles.css" />
      </Head>
      <div style={{ backgroundColor: indigo[400] }} className="background">
        <Card className={['card']}>
          <CardContent>
            <Typography className={['card-title']} gutterBottom>
              Que tipo de empreendedor é você durante a crise?
            </Typography>
            <hr />
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardContent>
          <CardActions>
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardActions>
          <div className={['card-footer']}>
            <hr />
            <Button variant="contained" color="primary" className={['button']}>
              Próxima Pergunta
            </Button>
          </div>
        </Card>
      </div>
    </>
  );
};

export default Quiz;
